import React from 'react'

const UserItem = ({user}) => {
  return (
    <div>
        <h4>Login: {user.login}</h4>
        <h4>Role: {user.role}</h4>
        <h4>Rating: {user.rating}</h4>
    </div>
  )
}

export default UserItem
